import React, { useState } from 'react';
import { reviewService, mlService } from '../services/api';
import { Review, SentimentAnalysis } from '../types/api';

const Home: React.FC = () => {
  const [movieTitle, setMovieTitle] = useState('');
  const [reviewText, setReviewText] = useState('');
  const [rating, setRating] = useState(5);
  const [sentiment, setSentiment] = useState<SentimentAnalysis | null>(null);
  const [isLoading, setIsLoading] = useState(false);
  const [error, setError] = useState('');
  const [success, setSuccess] = useState('');

  const handleSubmit = async (e: React.FormEvent) => {
    e.preventDefault();
    setError('');
    setSuccess('');
    setIsLoading(true);

    try {
      // First, analyze the sentiment
      const sentimentAnalysis = await mlService.analyzeSentiment(reviewText);
      setSentiment(sentimentAnalysis);

      // Then, create the review
      const review: Omit<Review, 'id' | 'userId' | 'createdAt' | 'updatedAt'> = {
        movieTitle,
        reviewText,
        rating,
        sentiment: sentimentAnalysis.sentiment,
      };

      await reviewService.createReview(review);
      setSuccess('Review submitted successfully!');
      
      // Reset form
      setMovieTitle('');
      setReviewText('');
      setRating(5);
      setSentiment(null);
    } catch (err: any) {
      setError(err.response?.data?.message || 'An error occurred while submitting the review');
    } finally {
      setIsLoading(false);
    }
  };

  return (
    <div className="max-w-4xl mx-auto px-4 py-8">
      <h1 className="text-3xl font-bold text-center mb-8">Movie Review Sentiment Analysis</h1>
      
      <form onSubmit={handleSubmit} className="space-y-6">
        <div>
          <label htmlFor="movieTitle" className="block text-sm font-medium text-gray-700">
            Movie Title
          </label>
          <input
            type="text"
            id="movieTitle"
            value={movieTitle}
            onChange={(e) => setMovieTitle(e.target.value)}
            required
            className="mt-1 block w-full rounded-md border-gray-300 shadow-sm focus:border-indigo-500 focus:ring-indigo-500 sm:text-sm"
          />
        </div>

        <div>
          <label htmlFor="reviewText" className="block text-sm font-medium text-gray-700">
            Your Review
          </label>
          <textarea
            id="reviewText"
            value={reviewText}
            onChange={(e) => setReviewText(e.target.value)}
            required
            rows={4}
            className="mt-1 block w-full rounded-md border-gray-300 shadow-sm focus:border-indigo-500 focus:ring-indigo-500 sm:text-sm"
          />
        </div>

        <div>
          <label htmlFor="rating" className="block text-sm font-medium text-gray-700">
            Rating
          </label>
          <select
            id="rating"
            value={rating}
            onChange={(e) => setRating(Number(e.target.value))}
            className="mt-1 block w-full rounded-md border-gray-300 shadow-sm focus:border-indigo-500 focus:ring-indigo-500 sm:text-sm"
          >
            {[1, 2, 3, 4, 5].map((value) => (
              <option key={value} value={value}>
                {value} {value === 1 ? 'star' : 'stars'}
              </option>
            ))}
          </select>
        </div>

        {error && (
          <div className="text-red-500 text-sm">{error}</div>
        )}

        {success && (
          <div className="text-green-500 text-sm">{success}</div>
        )}

        {sentiment && (
          <div className="p-4 rounded-md bg-gray-50">
            <h3 className="text-lg font-medium text-gray-900">Sentiment Analysis</h3>
            <p className="mt-2 text-sm text-gray-600">
              Sentiment: {sentiment.sentiment}
              <br />
              Confidence: {(sentiment.confidence * 100).toFixed(2)}%
            </p>
          </div>
        )}

        <button
          type="submit"
          disabled={isLoading}
          className="w-full flex justify-center py-2 px-4 border border-transparent rounded-md shadow-sm text-sm font-medium text-white bg-indigo-600 hover:bg-indigo-700 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-indigo-500 disabled:opacity-50"
        >
          {isLoading ? 'Analyzing...' : 'Submit Review'}
        </button>
      </form>
    </div>
  );
};

export default Home;
